import React from 'react';
import { 
  Fab, 
  Badge, 
  Tooltip, 
  Box,
  Typography,
  Paper
} from '@mui/material';
import { motion, AnimatePresence } from 'framer-motion';
import { ShoppingCart, X, Check } from 'lucide-react';

const FloatingCartButton = ({ cartItems, onViewCart, onClearCart }) => {
  const cartCount = cartItems.length;
  const totalPrice = cartItems.reduce((sum, item) => {
    const price = parseFloat(item.price.replace(/[^0-9.]/g, ''));
    return sum + price;
  }, 0);

  const buttonVariants = {
    hidden: { scale: 0, opacity: 0 },
    visible: { 
      scale: 1, 
      opacity: 1,
      transition: {
        type: "spring",
        stiffness: 260,
        damping: 20
      }
    },
    hover: {
      scale: 1.1,
      transition: {
        type: "spring",
        stiffness: 400,
        damping: 10
      }
    },
    tap: {
      scale: 0.95
    }
  };

  const badgeVariants = {
    hidden: { scale: 0, rotate: -180 },
    visible: { 
      scale: 1, 
      rotate: 0,
      transition: {
        type: "spring",
        stiffness: 500,
        damping: 30
      }
    }
  };

  return (
    <Box sx={{ position: 'fixed', bottom: 24, right: 24, zIndex: 1000 }}>
      <AnimatePresence>
        {cartCount > 0 && (
          <motion.div
            variants={buttonVariants}
            initial="hidden"
            animate="visible"
            whileHover="hover"
            whileTap="tap"
          >
            <Tooltip 
              title={
                <Box>
                  <Typography variant="body2" sx={{ fontWeight: 'bold' }}>
                    Cart ({cartCount} items)
                  </Typography>
                  <Typography variant="body2">
                    Total: ${totalPrice.toFixed(2)}/month
                  </Typography>
                </Box>
              }
              placement="left"
            >
              <Fab
                color="primary"
                size="large"
                onClick={onViewCart}
                sx={{
                  background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                  boxShadow: 4,
                  '&:hover': {
                    background: 'linear-gradient(135deg, #5a6fd8 0%, #6a4190 100%)',
                    boxShadow: 8
                  }
                }}
              >
                <Badge 
                  badgeContent={cartCount} 
                  color="error"
                  sx={{
                    '& .MuiBadge-badge': {
                      fontSize: '0.75rem',
                      fontWeight: 'bold'
                    }
                  }}
                >
                  <motion.div
                    variants={badgeVariants}
                    initial="hidden"
                    animate="visible"
                  >
                    <ShoppingCart size={24} />
                  </motion.div>
                </Badge>
              </Fab>
            </Tooltip>
          </motion.div>
        )}
      </AnimatePresence>

      {/* Quick Cart Preview */}
      <AnimatePresence>
        {cartCount > 0 && (
          <motion.div
            initial={{ opacity: 0, y: 20, scale: 0.8 }}
            animate={{ opacity: 1, y: 0, scale: 1 }}
            exit={{ opacity: 0, y: 20, scale: 0.8 }}
            transition={{ duration: 0.3 }}
            style={{
              position: 'absolute',
              bottom: 80,
              right: 0,
              width: 300
            }}
          >
            <Paper 
              elevation={8}
              sx={{ 
                p: 2, 
                borderRadius: 3,
                background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
                border: '2px solid',
                borderColor: 'primary.main'
              }}
            >
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                <Typography variant="h6" fontWeight="bold" color="text.primary">
                  Cart Preview
                </Typography>
                <motion.div
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.9 }}
                >
                  <Tooltip title="Clear Cart">
                    <Box
                      component="button"
                      onClick={onClearCart}
                      sx={{
                        border: 'none',
                        background: 'none',
                        cursor: 'pointer',
                        p: 0.5,
                        borderRadius: 1,
                        '&:hover': {
                          bgcolor: 'error.light'
                        }
                      }}
                    >
                      <X size={16} color="error" />
                    </Box>
                  </Tooltip>
                </motion.div>
              </Box>

              <Box sx={{ maxHeight: 200, overflowY: 'auto' }}>
                {cartItems.map((item, index) => (
                  <motion.div
                    key={item.id}
                    initial={{ opacity: 0, x: -20 }}
                    animate={{ opacity: 1, x: 0 }}
                    transition={{ delay: index * 0.1 }}
                  >
                    <Box sx={{ 
                      display: 'flex', 
                      justifyContent: 'space-between', 
                      alignItems: 'center',
                      p: 1,
                      mb: 1,
                      borderRadius: 1,
                      bgcolor: 'background.paper'
                    }}>
                      <Box>
                        <Typography variant="body2" fontWeight="medium" color="text.primary">
                          {item.tierName}
                        </Typography>
                        <Typography variant="caption" color="text.secondary">
                          {item.subBundleName}
                        </Typography>
                      </Box>
                      <Typography variant="body2" fontWeight="bold" color="primary.main">
                        {item.price}
                      </Typography>
                    </Box>
                  </motion.div>
                ))}
              </Box>

              <Box sx={{ 
                mt: 2, 
                pt: 2, 
                borderTop: '1px solid',
                borderColor: 'divider'
              }}>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                  <Typography variant="subtitle1" fontWeight="bold" color="text.primary">
                    Total
                  </Typography>
                  <Typography variant="h6" fontWeight="bold" color="primary.main">
                    ${totalPrice.toFixed(2)}/month
                  </Typography>
                </Box>

                <motion.div
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                >
                  <Box
                    component="button"
                    onClick={onViewCart}
                    sx={{
                      width: '100%',
                      py: 1.5,
                      px: 2,
                      bgcolor: 'primary.main',
                      color: 'white',
                      border: 'none',
                      borderRadius: 2,
                      fontWeight: 'bold',
                      cursor: 'pointer',
                      '&:hover': {
                        bgcolor: 'primary.dark'
                      }
                    }}
                  >
                    <Check size={16} style={{ marginRight: 8, verticalAlign: 'middle' }} />
                    Proceed to Checkout
                  </Box>
                </motion.div>
              </Box>
            </Paper>
          </motion.div>
        )}
      </AnimatePresence>
    </Box>
  );
};

export default FloatingCartButton;
